import React, { useState } from 'react';
import PersonaService from '../services/PersonaService';

const Register = () => {
  const [user, setUser] = useState(PersonaService.getDefaultUser());

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser((prevUser) => ({
      ...prevUser,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await PersonaService.registerUser(user);
      // Manejar el registro exitoso (puedes redirigir o mostrar un mensaje)
      alert('Registro exitoso');
    } catch (error) {
      // Manejar el error
      console.error('Error durante el registro:', error);
      alert('Error durante el registro');
    }
  };

  return (
    <div className="container">
      <h2>Registro de Usuario</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="primerNombre">Primer Nombre:</label>
          <input
            type="text"
            className="form-control"
            name="primerNombre"
            value={user.primerNombre}
            onChange={handleChange}
            placeholder="Primer Nombre"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="segundoNombre">Segundo Nombre:</label>
          <input
            type="text"
            className="form-control"
            name="segundoNombre"
            value={user.segundoNombre}
            onChange={handleChange}
            placeholder="Segundo Nombre"
          />
        </div>
        <div className="form-group">
          <label htmlFor="primerApellido">Primer Apellido:</label>
          <input
            type="text"
            className="form-control"
            name="primerApellido"
            value={user.primerApellido}
            onChange={handleChange}
            placeholder="Primer Apellido"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="segundoApellido">Segundo Apellido:</label>
          <input
            type="text"
            className="form-control"
            name="segundoApellido"
            value={user.segundoApellido}
            onChange={handleChange}
            placeholder="Segundo Apellido"
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            className="form-control"
            name="email"
            value={user.email}
            onChange={handleChange}
            placeholder="Email"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="identificacion">Identificación:</label>
          <input
            type="text"
            className="form-control"
            name="identificacion"
            value={user.identificacion}
            onChange={handleChange}
            placeholder="Identificación"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="fechaNacimiento">Fecha de Nacimiento:</label>
          <input
            type="date"
            className="form-control"
            name="fechaNacimiento"
            value={user.fechaNacimiento}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="usuario">Usuario:</label>
          <input
            type="text"
            className="form-control"
            name="usuario"
            value={user.usuario}
            onChange={handleChange}
            placeholder="Usuario"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="password">Contraseña:</label>
          <input
            type="password"
            className="form-control"
            name="password"
            value={user.password}
            onChange={handleChange}
            placeholder="Contraseña"
            required
          />
        </div>
        <button type="submit" className="btn btn-primary">Registrar</button>
      </form>
    </div>
  );
};

export default Register;
